import Link from "next/link"
import Head from "next/head"
import logo from "../assets/exam.png"
export default ({loggedIn, accountName, userID}) => (
    <div className="main">
        <Head>
            <link href="https://fonts.googleapis.com/icon?family=Material+Icons" rel="stylesheet" />
        </Head>
            <Link href={loggedIn ? '/liked' : 'login'}>
                <a className="heart">
                    <i class="material-icons">{loggedIn ? "favorite" : "favorite_border"}</i>
                </a>
            </Link>
            <Link href={loggedIn ? '/upload' : 'login'}>
                <a className='flex'>
                    <i class="material-icons">file_upload</i>
                </a>
            </Link>
            {loggedIn ? <Link href={`/user/${userID}`}><a>{accountName}</a></Link> : null}
            {!loggedIn ? <Link href="/login"><a>Login</a></Link> : null}
            {!loggedIn ? <Link href="/signup"><a>Sign up</a></Link> : null}

    <style jsx>{`
        .main {
            display: flex;
            flex-direction: row;
            justify-content: flex-end;
            align-items: center;
            height: 4rem;
            background: rgb(0,0,0);
        }

        .logo {
            position: absolute;
            top: .65rem;
            left: .5rem;
            width: 32px;
            height: 32px
        }

        a {
            text-decoration: none;
            color: rgb(255,255,255);
            font-size: 1.1rem;
            margin: 0 .4rem 0 .4rem;
            letter-spacing: .09rem
        }

        a:hover {
            color: rgb(222, 218, 217);
        }

        .flex {
            display: flex;
            width: 24px;
            ${!loggedIn ? 'color: rgb(156, 156, 156);' : null}
        }

        .heart {
            display: flex;
            width: 24px;
            color: rgba(250, 0, 0, 0.8);
        }
    `}</style>
    </div>
)
